import React, { Component } from "react";
import UtenteDataService from "../../services/tutorial.service";
import { withRouter } from '../../common/with-router';
import {Form} from 'protected-aidaforms';
import json from './InitialEvaluation.js';

class Avininum extends Component {
  constructor(props) {
    super(props);
    this.onChangenome_utente = this.onChangenome_utente.bind(this);
    this.onChangeDescription = this.onChangeDescription.bind(this);
    this.getUtente = this.getUtente.bind(this);
    this.updatePublished = this.updatePublished.bind(this);
    this.updateUtente = this.updateUtente.bind(this);
    this.deleteUtente = this.deleteUtente.bind(this);

    this.state = {
      currentUtente: {
        num_sequencial: null,
        sexo: "",
        nome_utente: "", 
        data_nascimento: new Date()
      },
      message: ""
    };
  }

  render() {
    const { currentUtente } = this.state;

    return (
      <Form
       onSubmit={(values, changedFields) => console.log("SUBMITTED VALUES: ", values, "CHANGED FIELDS: ", changedFields)}
       onSave={(values, changedFields) => console.log("SAVED VALUES: ", values, "CHANGED FIELDS: ", changedFields)}
       onCancel={status => console.log("CANCELLED:", status)}
       template={json}
       dlm={{}}
       showPrint={true}
       editMode={true}
       professionalTasks={["Registar Pedido", "Consultar Pedido", "Anular Pedido"]}
       canSubmit={true}
       canSave={true}
       canCancel={true}
       patientData={{
       "numSequencial": currentUtente.num_sequencial,
       "episodio": 21016848,
       "modulo": "INT",
       "processo": 99998888,
       "nome": currentUtente.nome_utente,
       "dtaNascimento": currentUtente.data_nascimento,
       "idade": 77,
       "sexo": currentUtente.sexo
       }}
       reportData={{
       dtaEncerrada: "22-05-2019 13:02",
       dtaCriada: "10-05-2019 18:47",
       realizada: "Joana Pascoal",
       responsavel: "José Costa"
       }}
       referenceModel={[
        {"itemName": "Número mecanográfico",
        "item": "num_mecanografico",
        "value": "123456",
        "formVisible": true
        },
        {"itemName": "Número sequencial",
        "item": "num_seq",
        "value": 1347095,
        "formVisible": true
        },
        {"itemName": "Nome",
        "item": "Nome",
        "value": "José da Silva Pinto",
        "formVisible": true
        }
        ]}
        submitButtonDisabled={false}
        saveButtonDisabled={false}
       />
        );
  }
}

export default withRouter(Avininum);
